import axios from "axios";
import React, { useState, useEffect } from "react";
import { Table } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import "./user_detail.css";

function User_detail() {
  const [user, setUser] = useState([]);
  const navigate = useNavigate();
  const user_data = JSON.parse(localStorage.getItem("user_data"));

  useEffect(() => {
    // console.log(user[1].created_at)
    axios
      .get("http://localhost:8000/tracenet_user/", {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Token ${user_data.key}`,
        },
      })
      .then((customers) => {
        console.log(customers.data);
        setUser(customers.data);
      });
  }, []);

  const handleClick = (data, e) => {
    let url = "http://localhost:8000/tracenet_user/" + data.id;
    if (e.target.value == "Login") {
      console.log(data);
      navigate("/dashboard/tracenet", { state: data });
    } else if (e.target.value == "Update") {
        navigate("/dashboard/")
    //   axios
    //     .post(url, {
    //       headers: {
    //         "Content-Type": "application/json",
    //         Authorization: `Token ${user_data.key}`,
    //       },
    //     })
    //     .then((res) => {
            console.log(data)
        // });
    } else {
      {
        window.confirm("Are you sure you want to delete ?")
          ? axios
              .delete(url, {
                headers: {
                  "Content-Type": "application/json",
                  Authorization: `Token ${user_data.key}`,
                },
              })
              .then((res) => {
                let filterData = user.filter((item, key) => {
                    console.log(item.id , data.id)
                  return item.id != data.id;
                });
                setUser(filterData);
              })
              .catch((err) => console.log(err))
          : console.log("false");
      }
    }
  };

  return (
      <div className="content-wrapper">
        <div class="card">
<div class="card-header">
<h3 class="card-title">Simple Full Width Table</h3>
<div class="card-tools">
<ul class="pagination pagination-sm float-right">
<li class="page-item"><a class="page-link" href="#">«</a></li>
<li class="page-item"><a class="page-link" href="#">1</a></li>
<li class="page-item"><a class="page-link" href="#">2</a></li>
<li class="page-item"><a class="page-link" href="#">3</a></li>
<li class="page-item"><a class="page-link" href="#">»</a></li>
</ul>
</div>
</div>

<div class="card-body p-0">
<table class="table">
<thead>
<tr>
<th style="width: 10px">#</th>
<th>Task</th>
<th>Progress</th>
<th style="width: 40px">Label</th>
</tr>
</thead>
<tbody>
<tr>
<td>1.</td>
<td>Update software</td>
<td>
<div class="progress progress-xs">
<div class="progress-bar progress-bar-danger" style="width: 55%"></div>
</div>
</td>
<td><span class="badge bg-danger">55%</span></td>
</tr>
<tr>
<td>2.</td>
<td>Clean database</td>
<td>
<div class="progress progress-xs">
<div class="progress-bar bg-warning" style="width: 70%"></div>
</div>
</td>
<td><span class="badge bg-warning">70%</span></td>
</tr>
<tr>
<td>3.</td>
<td>Cron job running</td>
<td>
<div class="progress progress-xs progress-striped active">
<div class="progress-bar bg-primary" style="width: 30%"></div>
</div>
</td>
<td><span class="badge bg-primary">30%</span></td>
</tr>
<tr>
<td>4.</td>
<td>Fix and squish bugs</td>
<td>
<div class="progress progress-xs progress-striped active">
<div class="progress-bar bg-success" style="width: 90%"></div>
</div>
</td>
<td><span class="badge bg-success">90%</span></td>
</tr>
</tbody>
</table>
</div>

</div>





